import React from 'react'


export default class Options extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            checked: 'false'
        }
    }


    render() {
        return (
            <div>
                {<input type="checkbox" onChange={this.handleCheck} checked={this.props.checked}/>}
                <label>{this.props.label}</label>
            </div>
        )
    }
}
